import React,{Component} from 'react';
import  ServiceCatagories from '../Components/ServiceCatagories';
import FamousServices from '../Components/FamousServices';
import Feedbacks from '../Components/Feedbacks';
import Footer from '../Components/Footer';
import SiteIntro from '../Components/SiteIntro';
import AddFeedback from '../Components/AddFeedback';

class SubMainScreen extends Component{
	state={
		'login':this.props.login,
	}

	handleChooseCatagory(id){
		alert('Opening'+id);
	}

	handleOpenService(id){
		alert(id);
	}

	render(){
		const a = [{'id':1},{'id':2},{'id':3},{'id':4},{'id':5}];
		return(
			<div>

				{this.state.login?'':<SiteIntro/>}

				<ServiceCatagories
				 data={a}
				 handleChooseCatagory={this.handleChooseCatagory}
				/>

				<FamousServices data={a} handleOpenService={this.handleOpenService}/>

				<Feedbacks data={a}/>
				{this.state.login?<AddFeedback/>:''}
				<hr/>
				<Footer/>

			</div>
		);
	}
}

export default SubMainScreen;
